import Card from '../Card/Card';
import './ConfirmModal.css'
const ConfirmModal = props => {
    return <Card className="confirmModal">
        <div className='confirmText'>
            该操作不可恢复！确认吗？
        </div>
        <div>
            <button>确认</button>
            <button>取消</button>
        </div>
    </Card>
};
export default ConfirmModal;
